  const [regions, setRegions] = useState<NodeList>();

  useEffect(() => {
    const mapNodeRegions = document.querySelectorAll("svg g[id*=Region]");
    setRegions(mapNodeRegions);
  }, []);

  function showHoveredRegion(e: any) {
    let currentNode = e.target;
    let hoveredRegionId: string = "";
    // Traverse up the DOM tree until we find a parent with an ID containing "region"
    while (currentNode && !hoveredRegionId) {
      if (currentNode.id && currentNode.id.includes("Region")) {
        hoveredRegionId = currentNode.id;
      } else {
        currentNode = currentNode.parentNode;
      }
    }

    if (!hoveredRegionId) {
      // If no parent with ID containing "region" was found, exit the function
      return;
    }
    regions?.forEach((region: any) => {
      if (region.id === hoveredRegionId) {
        region.style.opacity = 1;
        region.style.transform = "translateY(-10px)";
      } else {
        console.log(hoveredRegionId);
        region.style.opacity = 0.3;
        region.style.transform = "translateY(0px)";
      }
    });
  }

